function Result() {

    return(
        <>
            <div className="top-left-image">
                <button className="btn btn-danger" style={{
                    position : "absolute",
                    fontSize : "20px",
                    marginLeft : "70",
                    borderRadius: "100%"
                }}>다른<br/>이미지</button>
                <img src = {process.env.PUBLIC_URL + "/image_src/sample.png"}
                    style = {{
                        marginTop : "8%",
                        width : "75%",
                        height : "85%",
                        borderRadius : "40px",
                    }}/>

            </div>
            <div className="bottom-left-text">
                <br/><br/><br/><br/><br/>첨부 이미지 모델 스펙 출력 영역
            </div>
            <div className="right-image" style={{

            }}>
                <br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/>
                결과 이미지 출력 영역
            </div>
        </>

    );
}

export default Result;
